```sparql
SELECT ?name ?lat WHERE {
  ?port a ns2:Port ;
        rdfs:label ?name ;
        ns2:hasLatitude ?lat .
} ORDER BY DESC(?lat)
LIMIT 1
```

You are right. The query only considers `rdfs:label` for the name of the port, but some ports have the name as `ns1:hasPortName`.

```sparql
SELECT ?name ?lat WHERE {
  ?port a ns2:Port ;
        ns2:hasLatitude ?lat .
  OPTIONAL { ?port rdfs:label ?name . }
  OPTIONAL { ?port ns1:hasPortName ?name .}
} ORDER BY DESC(?lat)
LIMIT 1
```

