You are absolutely right! My apologies, I missed a crucial detail. The label "small harbor size" is attached to the SizeClass, not directly to the `ns1:hasPortSize` property. 

Here's the corrected query:

```sparql
SELECT ?sizeLabel WHERE {
  ?port rdfs:label "Juneau" ;
        ns1:hasPortSize ?size .
  ?size a ns1:SizeClass ;
        rdfs:label ?sizeLabel .
}
```

This query now correctly identifies the `ns1:hasPortSize` value as a `ns1:SizeClass` and then retrieves the label associated with that class.

