You are absolutely right! My previous query was flawed. I forgot to consider that the geometry information is linked via `geo:hasGeometry`. 

Here is the corrected query:

```sparql
SELECT ?name WHERE {
  ?port a ns2:Port ;
        rdfs:label ?name ;
        geo:hasGeometry ?geo .
  ?geo geo:asWKT ?wkt .
  BIND(STRBEFORE(STRAFTER(?wkt, " "), " ") AS ?lat)
}
ORDER BY DESC(?lat)
LIMIT 1
```

