```sparql
PREFIX ns1: <https://schema.coypu.org/global#>
PREFIX ns2: <https://schema.coypu.org/world-port-index#>

SELECT ?name WHERE {
  ?port a ns1:Port ;
        ns1:hasLatitude ?lat ;
