```sparql
SELECT ?name WHERE {
  ?port a ns1:Port ;
        ns1:hasLatitude ?lat ;
        ns1:hasPortName ?name .
}
ORDER BY DESC(?lat)
LIMIT 1
```

```sparql
PREFIX ns1: <https://schema.coypu.org/world-port-index#>
PREFIX ns2: <https://schema.coypu.org/global#>

SELECT ?name WHERE {
  ?port a ns2:Port ;
        ns2:hasLatitude ?latitude ;
        ns1:hasPortName ?name .
} 
ORDER BY DESC(?latitude) 
LIMIT 1
```

